import { createStore } from 'vuex';

const store = createStore({
  state() {
    return {
        FormComponent:{
            Tipo: ''
        }

    };
  },
  mutations: {
    setProps(component,state,props) {
        switch(component){
            case 'FormComponent' :  state.FormComponent.Tipo = props.Tipo;
                                    break;
        }

    },
  },
});

export default store;
